const queryForFile = (content_id, lang_id, fileid) => {
  return query = `
  SELECT  
         ser.content_folder_name
        FROM     master_files mf
JOIN     content_file_media cfm
ON       mf.file_id = cfm.file_id
JOIN     main_content mc
ON       mc.content_id = cfm.content_id
JOIN     content_logs cl
ON       cl.content_id = mc.content_id
JOIN     content_language_country clc
ON       mc.content_id = clc.content_id
JOIN     language_country_rack lcr
ON       lcr.id = clc.language_country_id
JOIN     language_master lm
ON       lcr.language_id = lm.language_id
JOIN     services ser
ON       ser.service_id = mc.service_id
JOIN     type_details td
ON       td.content_id = mc.content_id
JOIN     templates tem
ON       tem.template_id = mf.template_id
WHERE    cl.action IN(1,
                      2,
                      3)
AND      cl.status = 1
AND      mc.status = 1
and mc.content_id=${content_id}
and lm.language_id=${lang_id}
and mf.file_id = ${fileid}
GROUP  BY mf.file_id, mc.content_id, lcr.language_id
  `
}
const queryForCrs = (content_id, lang_id, fileid, crs_id) => {
  return query = `
  

  SELECT 
       cf.file_type
       
FROM   crs_file cf
       JOIN crs_master cm
         ON cf.crs_id = cm.crs_id
       JOIN crs_group cg
         ON cm.group_id = cg.group_id
       JOIN crs_type ct
         ON cg.type_id = ct.type_id
       JOIN content_crs cc
         ON cm.crs_id = cc.crs_id
       JOIN main_content mc
         ON mc.content_id = cc.content_id
       JOIN content_language_country clc
         ON mc.content_id = clc.content_id
       JOIN content_logs cl
         ON cl.content_id = mc.content_id
       JOIN language_country_rack lcr
         ON lcr.id = cf.language_country_id
       JOIN language_master lm
         ON lcr.language_id = lm.language_id
       JOIN type_details td
         ON td.content_id = mc.content_id
       JOIN services ser
         ON ser.service_id = mc.service_id
WHERE  ser.service_type = "crs"
       AND cl.action = 3
       AND td.description = 'Main'
       AND td.type_id = 8
       AND cl.status = 1
       AND mc.status = 1
and mc.content_id=${content_id}
and lcr.language_id=${lang_id}
and cf.file_id = ${fileid}
and cm.crs_id=${crs_id}
GROUP  BY cf.file_id,
          mc.content_id,
          lcr.language_id
  `
}
const queryForLms = (content_id, lang_id, lmsid) => {
  return query = `
  SELECT 
       ser.content_folder_name,
       tm.template_name
FROM   lms ls
       JOIN content_lms clm
         ON ls.lms_id = clm.lms_id
       JOIN main_content mc
         ON mc.content_id = clm.content_id
       INNER join slides on slides.lms_id = clm.lms_id
       INNER join template_master tm on tm.template_id =slides.template_id  
       JOIN content_logs cl
         ON cl.content_id = mc.content_id
       JOIN content_language_country clc
         ON mc.content_id = clc.content_id
       JOIN language_country_rack lcr
         ON lcr.id = clc.language_country_id
       JOIN language_master lm
         ON lcr.language_id = lm.language_id
       JOIN services ser
         ON ser.service_id = mc.service_id
WHERE  cl.action IN ( 1, 2, 3 )
       AND ser.service_type = "lms"
       AND cl.status = 1
       AND mc.status = 1
       and mc.content_id=${content_id}
and lm.language_id=${lang_id}
and ls.lms_id = ${lmsid}

GROUP  BY ls.lms_id,
          mc.content_id,
          lcr.language_id
          
          
  `
}
const queryForLo = (content_id, lang_id, contentTypeId) => {
  return query = `
  SELECT 
       ser.content_folder_name
FROM   type_details td
       JOIN main_content mc
         ON mc.content_id = td.content_id
       JOIN content_logs cl
         ON cl.content_id = mc.content_id
       JOIN content_language_country clc
         ON mc.content_id = clc.content_id
       JOIN language_country_rack lcr
         ON lcr.id = clc.language_country_id
       JOIN language_master lm
         ON lcr.language_id = lm.language_id
       JOIN services ser
         ON ser.service_id = mc.service_id
WHERE  mc.content_type = 'lo'
       AND cl.action IN ( 1, 2, 3 )
       AND cl.status = 1
       AND mc.status = 1
       and mc.content_id=${content_id}
and lm.language_id=${lang_id}
and td.content_type_id = ${contentTypeId}
GROUP  BY td.content_type_id,
          mc.content_id,
          lcr.language_id
         
  `
}


Updatations.updateFileData = function (result) {
  const dbo = MongoClient.db(con.dbName);
  const res_arr = []
  new Promise((resolve, reject) => {
    dbo.collection("main_content_file").find({ "content_type": "file" }).toArray(function (err, docs) {

      docs.forEach(function (doc, index) {
        const query = queryForFile(doc.old_content_id, doc.language_id, doc.file_id)
        sql.query(query, function (err, res) {
          res_arr.push({ data: res, id: doc._id })
          dbo.collection("main_content_file").update({ _id: doc._id },
            { $set: { "content_folder_name": res[0].content_folder_name } });

          if (docs.length == (index + 1)) {
            resolve(res_arr)
          }
        })
      });
    });
  }).then((data) => {
    result(null, data)
  })

}


Updatations.updateCrsData = function (result) {
  const dbo = MongoClient.db(con.dbName);
  const res_arr = []
  new Promise((resolve, reject) => {
    dbo.collection("main_content_file").find({ "content_type": "crs" }).toArray(function (err, docs) {

      docs.forEach(function (doc, index) {
        if (typeof doc.crs_id == "undefined") {
          return;
        }
        const query = queryForCrs(doc.old_content_id, doc.language_id, doc.file_id, doc.crs_id)

        const sqlss = sql.query(query, function (err, res) {
          if (err) {
            throw new Error(err);
          }

          //console.log(res, doc.old_content_id, doc.language_id, doc.file_id, doc.crs_id)          
          //if (typeof res == "undefined") {
          //          console.log(sqlss.sql, res)
          //      }
          res_arr.push({ data: res, id: doc._id })
          //console.log(query);      
          const fileType = res[0].file_type

          const content_folder_name = (fileType == "VIDEO" ? "crsemr/public/resources/video/" :
            (fileType == "AUDIO" ? "crsemr/public/resources/audio/" :
              (fileType == "IMAGE" ? "crsemr/public/resources/images/" : null)))

          dbo.collection("main_content_file").update({ _id: doc._id },
            {
              $set: {
                "content_folder_name": content_folder_name,
                "file_type": fileType
              }
            });

          if (docs.length == (index + 1)) {
            resolve(res_arr)
          }
        })
      });
    });
  }).then((data) => {
    result(null, data)
  })


}


