Updatations.DeleteContentGraphDB = async function (element) {
  return
  const session = await neo4jDB.session({ database: NEO4J_DATABASE })
  try {
    const date = Updatations.todayDate()
    var result = await session.run(
      'match(n)-[rr:has_content]->(r) where  r.content_id=$content_id and rr.stage=1 set rr.stage=0, rr.detached_by_mongo_script=1, rr.to=$today', {
      content_id: element.content_id,
      today: date
    })
    const query = `
    match(n)-[rr:has_content]->(r) where  r.old_content_id=${element.old_content_id}
     and rr.stage=1 set rr.stage=0,
     rr.detached_by_mongo_script=1, rr.to="${date}"
      `
    await Updatations.createGlobalQueryLog(query)




  }
  catch (e) {
    console.log(e)
  }
  finally {
    await session.close()
  }



}
Updatations.InsertContentGraphDB = async function (element) {
  return
  const session = await neo4jDB.session({ database: NEO4J_DATABASE })
  let count = 1;
  const timeBefore = Updatations.todayDateNSecondsBefore(60)
  try {
    // for (let singleData of data) {
    var result = await session.run(
      'match(n)-[rr:has_content]->(r) where  r.content_id=$content_id and rr.stage=0 and rr.detached_by_mongo_script=1 and rr.to>$deleteDate set rr.stage=1, rr.to="" REMOVE rr.detached_by_mongo_script', {
      content_id: element.content_id,
      deleteDate: timeBefore   //check if removed under 1 minutue
    })

    const query = `
    match(n)-[rr:has_content]->(r) where  r.content_id="${element.content_id}"
    and rr.stage=0 and rr.detached_by_mongo_script=1 and rr.to>"${timeBefore}" set rr.stage=1, 
    rr.to="" REMOVE rr.detached_by_mongo_script
      `
    await Updatations.createGlobalQueryLog(query)
  }
  catch (e) {
    console.log(e)
  }
  finally {
    await session.close()
  }
}


